import { BrowserRouter as Router, Routes, Route } from 'react-router-dom'
import logo from './logo.svg';
import './App.css';
import Banner from './components/Banner';

function App() {
  return (
    <div>
        <Header />
        <Router>
                <Routes>
                  <Route path='/' element={<Banner />}/>
                </Routes>
        </Router>
        <Footer />
    </div>
  );
}

export default App;
